      <Nav.Link href="google.com" target="_blank">LinkedIn</Nav.Link>
      <Nav.Link href="" target="_blank">GitHub</Nav.Link>
    </Nav>
  </Navbar.Collapse>
  </Container>
</Navbar>

);

}

export default Header;
